import React from "react";

export default class ListDays extends React.Component {
    render() {
        return (<ul>
            {this.props.days.map((f) => <li>{f.getDate() + "/" + (f.getMonth() +1) + "/" + f.getFullYear()}</li>)}
        </ul>)
    }
}
